let configScore = {
    assessment: 30,
    englishTime: 40,
    presentation: 10,
    selftCheck: 20,
}

/* 
    Ejemplo: setScoreStorage(module = 'M1', lesson= 'L1', {name: 'drag and drop', score: 100, type: 'selftCheck'} )
*/
let scoreActivities = JSON.parse(localStorage.getItem('scoreActivities'))
    ? JSON.parse(localStorage.getItem('scoreActivities'))
    : {}

function setScoreStorage(module, lesson, activity) {
    if (!scoreActivities[module]) scoreActivities[module] = {}
    if (!scoreActivities[module][lesson]) scoreActivities[module][lesson] = []

    let isValid = true
    let keyUpdateActivity = 0
    let updateActvity = null

    scoreActivities[module][lesson].forEach((currentActivity, key) => {
        if (
            currentActivity.name == activity.name &&
            currentActivity.type == activity.type
        ) {
            isValid = false

            updateActvity = activity
            keyUpdateActivity = key
        }
    })

    if (isValid) {
        scoreActivities[module][lesson].push(activity)
    } else if (updateActvity) {
        scoreActivities[module][lesson][keyUpdateActivity] = updateActvity
    }

    localStorage.setItem('scoreActivities', JSON.stringify(scoreActivities))
}

let allScore = {}

function getAllScore() {
    if (!scoreActivities)
        return console.error("There aren't data in ScoreACtivities")

    getKeysArray(scoreActivities).forEach((nameModule) => {
        let module = scoreActivities[nameModule]
        let message = `Modulo: ${nameModule}, `

        getKeysArray(module).forEach((nameLesson) => {
            let lesson = module[nameLesson]

            if (!lesson.length)
                return console.warn(
                    `${message} Lesson: ${nameLesson}: There aren't any activity`
                )

            let sum = 0
            let weighted = 0

            lesson.forEach((activity) => {
                if (activity.score > 100 || activity.score < 0)
                    return console.error(
                        `${message} Lesson: ${nameLesson}, Activity ${activity.name}: Invalid score `
                    )

                sum +=
                    parseInt(configScore[activity.type]) *
                    parseInt(activity.score)
                weighted += parseInt(configScore[activity.type])
            })

            let score = sum / weighted

            if (!allScore[nameModule]) allScore[nameModule] = {}

            allScore[nameModule][nameLesson] = Math.round(score)
            // saveScoreScorm( Math.round(score) );
        })
    })

    return scoreActivities
}

function getKeysArray(data) {
    let newData = []

    Object.keys(data).forEach((key) => newData.push(key))

    return newData
}

function saveScoreScorm(promedio) {
    scorm.SetInteractionValue('cmi.score.scaled', '0')
    let actualScore = 0

    computeTime() // the student has stopped here.

    actualScore = promedio

    scorm.SetScoreRaw(actualScore + '')
    scorm.SetScoreMax(100)
    scorm.SetScoreMin(0)

    let mode = scorm.GetMode()

    if (mode != 'review' && mode != 'browse') {
        if (actualScore < 50) {
            scorm.SetCompletionScormActivity('incomplete')
            scorm.SetSuccessStatus('failed')
            if (scorm.version == '2004') {
                scorm.SetInteractionValue('cmi.score.scaled', actualScore / 100)
            }
        } else {
            scorm.SetCompletionScormActivity('completed')
            scorm.SetSuccessStatus('passed')
            if (scorm.version == '2004') {
                scorm.SetInteractionValue('cmi.score.scaled', actualScore / 100)
            }
        }

        scorm.SetExit('')
    }

    exitPageStatus = true

    scorm.save()
    scorm.quit()
}

function getQueryVariable(variable) {
    let url = window.location.href.replace(/%20/g, ' ').split('/')

    try {
        let groupVars = url[url.length - 1].split('?')[1]
        let vars = groupVars.split('&')

        for (var i = 0; i < vars.length; i++) {
            var pair = vars[i].split('=')
            if (pair[0] == variable) {
                return pair[1]
            }
        }
        return false
    } catch (err) {
        return false
    }
}

function getRandomArray(data) {
    return data
        .map(value => ({ value, sort: Math.random() }))
        .sort((a, b) => a.sort - b.sort)
        .map(({ value }) => value)
}


